class UserInfo extends Component {
    constructor(props){
     super(props)
     this.state = {users:[]}
     this.handleclick = this.handleclick.bind(this);
    }
    render (){
        return (
            <div>
                mayank
            </div>
        )
    }
}
export default UserInfo;
